import MusiciansListItem from '../musicians-list-item/musicians-list-item';

import './musicians-list.css';

const MusiciansList = () => {
    return(
        <ul className="app-list list-group">
            <MusiciansListItem name="Ozzy Crazytrainov" salary={800}/>
            <MusiciansListItem name="Tony Doomov" salary={3000}/>
            <MusiciansListItem name="Bill Urod" salary={5000}/>
        </ul>
    );
}

export default MusiciansList;
